When inserting a resource in the world, you can optionally specify a destructor to be called when the resource is removed or the world destroyed: list_t *cool_stuff = list_from(3, "furries", "undertale", "you"); // the destroyer must be explicitly cast because C cannot implicitly cast
// function pointers, even when they are compatible.
gt_world_insert(world, "cool_stuff", data, (void (*)(void*)) &list_destroy); For resources which do not need to be destroyed (i.e. static value), just set the destroyer to NULL: gt_world_insert(world, "some_string", "Hey! This is a resource!", NULL);

