Say you want to create a new kind of component. For this example, we will create a "position" component class. The first step is to declare a new gt_component_class_t global constant. Usually, you will want to declare it in a header file with the extern keyword: extern const gt_component_class_t POSITION_COMP; And then, define it in your source file: const gt_component_class_t POSITION_COMP = { .name = "position_component", .destroyer = &my_free,
}; There are two important fields here: name - a static, unique character string that will be used as the key for the storage resource in the world. It must be unique and must not be used as the key for any other resource in the world . destroyer - a pointer to the function to be called when the component data is to be destroyed. Speaking about the component data: it can be anything you want! It is common to have a constructor for your component data (declared in the same header file as the gt_component_class_t it corresponds to): typedef struct { f64_t x; f64_t y;
} position_comp_t; position_comp_t *position_component(f64_t x, f64_t y); An example implementation could be: position_comp_t *position_component(f64_t x, f64_t y)
{ position_comp_t *self = my_calloc(1, sizeof(position_comp_t)); self->x = x; self->y = y; return (self);
}

