Components are stored in "storages" kept as a Resource in the World . Think of a storage as a simple array (that's basically what they are anyway). Keeping the table example from earlier, each component "storage" corresponds to a line of the table. That means there's one storage per component type. player villager sword play_button Position (3, 4) (17, 12) (-4, 1) (40, 160) Sprite player.png villager.png sword.png - Color - - - #88FF00 In this example, there are 3 storages: one for Position components, one for Sprite components and another for Color components. Each line is a storage. There are two implementations of storage in the libgote: gt_vec_storage - literally just a vector: better when most entities will have this component (there's very few "holes"). gt_map_storage - uses a hash map: better when few entities will have this component (there are many, big "holes"). Not implemented as of writing this. Do not use. As a component storage is just a resource in the world, you add them just like any other resource: // create the storage (here it's just a vector/array!)
gt_storage_t *strg = gt_vec_storage(); gt_world_insert( world, POSITION_COMP.name, strg, (void (*)(void*)) &gt_storage_destroy
); Though, having to do that for every component type would be kinda annoying. This is why the gt_world_register function exists! It takes care of the last argument (the destroyer): gt_storage_t *strg = gt_vec_storage(); gt_world_register(world, POSITION_COMP.name, strg); But there's even better than this! The gt_world_register_component function! gt_world_register_component(world, &POSITION_COMP, &gt_vec_storage); Here, all you have to give is a pointer to the gt_component_class_t and a pointer to the constructor for the storage implementation to use. It does the exact same thing as the code snippets above!

