You cannot create an entity from nothing (there's no "gt_entity_create" function). The reason for this is that an entity only makes sense when it is part of a world, with the appropriate storages available. You can create entities with the gt_world_create_entity function: The arguments are: The world How many components to initialize the entity with For each initial component: A pointer to the gt_component_class_t The component data For example, to create an entity using our position_comp_t: gt_entity_t *ent = gt_world_create_entity(world, 1, &POSITION_COMP, position_component(2.0, 6.0)
); Or with more components you've created (don't forget to change the component count!): gt_entity_t *player = gt_world_create_entity(world, 3, &POSITION_COMP, position_component(2.0, 6.0), &SPRITE_COMP, sprite_component("player.png"), &INVENTORY_COMP, inventory_component()
); Of course, if you want to create an entity without any component: gt_entity_t *ent = gt_world_create_entity(world, 0);

