When you're done using an entity, you have to manually remove it from the world! State s do not know about the entities you've created, so they are not removed automatically! To remove entities, use the gt_world_remove_entity function: /* Remove the player entity when the state stops */
static void combat_state_on_stop(void *ptr, gt_world_t *world)
{ struct combat_state *self = ptr; gt_world_remove_entity(world, self->player);
}

