To create a state with the libgote, use calloc to allocate a gt_state_t structure and set the callback functions you care about: gt_state_t *create_combat_state(void)
{ gt_state_t *state = my_calloc(1, sizeof(gt_state_t)); state->update = &combat_state_update; return (state);
} Of course, update isn't the only callback available to game states. Here is a list of the most commonly used: on_start - called when the state starts. on_stop - called when the state stops. update - called on every iteration of the game loop while the state is active. destroy - called when the state is destroyed, use it to free the self field. The libgote will safely ignore any callback set to NULL. This is why you should use calloc to allocate the gt_state_t structure (calloc ensures all the allocated bytes are set to NULL or 0). The self field allows you to store arbitrary data associated with your state. Its value is passed as an argument to all the callbacks. In most cases, you will use it to keep a reference to data you want to clean-up when the state is stopped: /* Structure holding the data associated with the state */
struct combat_state { player_t *player;
}; /* Create the player when the state starts */
static void combat_state_on_start(void *ptr, gt_world_t *world)
{ struct combat_state *self = ptr; self->player = player_create(world);
} /* Remove the player when the state stops */
static void combat_state_on_stop(void *ptr, gt_world_t *world)
{ struct combat_state *self = ptr; player_remove(self->player, world);
} /* Create the state, its data structure, and set the callbacks */
gt_state_t *create_combat_state(void)
{ gt_state_t *state = my_calloc(1, sizeof(gt_state_t)); state->self = my_calloc(1, sizeof(struct combat_state)); state->destroy = &my_free; state->on_start = &combat_state_on_start; state->on_stop = &combat_state_on_stop; return (state);
} Make sure not to forget to set state->destroy to an appropriate freeing function! If you don't do it, memory WILL leak!
